import React from 'react';

class MessagePane extends React.Component {
   render(){
      return(
         <div id="messagePaneContainer" class={this.props.show}>
            <div id="messagePane">
               <div id="interactionBox">
                  <div id="messageBox">
                  </div>
                  <div id="interactionBoxMenu"></div>
                  <button id="sendMessageButton"/>
               </div>
            </div>
         </div>
      );
   }
}
export default MessagePane;
